import React, { useState, useEffect } from "react";



function Player(props){
const [playerInfo, setPlayerInfo] = useState({});
useEffect(
    setPlayerInfo(props), 
    [playerInfo]);

return (<div><p>Player {playerInfo.participantIndex + 1}: {playerInfo.summonerName}, K/D/A: {playerInfo.kills} / {playerInfo.deaths} / {playerInfo.assists}</p>
                <h1>Champion: {playerInfo.championName}</h1> <img src = {`http://ddragon.leagueoflegends.com/cdn/12.9.1/img/champion/${playerInfo.championName}.png`} alt = "Champion-Splash-Img"></img>
                <h3>Lane: {playerInfo.lane}</h3>
        </div>);
}

export default Player;
